import React from 'react'
import Rating from './Rating'
import Container from '@mui/material/Container';

function ScoresAndStats({report}) {
    const accuracy = (report? report['accuracy'] : 0.0)
    //const classesScores = report?['classes_scores']
    //const bestFeaturesLabels = report?['best_features_labels']

    return (
        <Container maxWidth='md' sx={{width: "90%"}}>

                <Rating value={(accuracy * 5)}/>
                <hr/>
                Model accuracy = {accuracy}
                <hr/>
                * Accuracy may vary from classification to classification.

            
        </Container>
    )
}

export default ScoresAndStats
